              </div>
            </div>
            <div class="col-md-4 col-sm-6">
              <div class="single-about-detail">
                <div class="about-img">
                  <img class="img-responsive" src="img/item2.jpg" alt="" />
                </div>
                <div class="about-details">
                  <div class="pentagon-text">
                    <h1>W</h1>
                  </div>

                  <h3>Children’s specialist</h3>
                  <p>
